import { TextField } from "@mui/material";
import React from "react";
import SearchIcon from "@mui/icons-material/Search";
function ItemCreation() {
  return (
    <div className="p-10">
      <div>
        <TextField size="small" fullWidth label="Search by ItemName/ItemCode" />
        <button type="button" className="bg-indigo-900 text-white rounded p-2">
          <SearchIcon />
        </button>
        <button className="bg-indigo-900 text-white">
+ Add
        </button>
      </div>
    </div>
  );
}

export default ItemCreation;
